@missymisdemeanorelliott posted this Throwback from one of SIX looks I created on her from the “Throw it Back” music video 😍. We filmed this April 9th, 2019!!! Baby the time and work we all put into those days for those music videos was craaaaaaaaazzyyyyy. Imagine six straight 14-18 hr days with 8hr breaks in between. We shot 4 music videos in 6 days lol. But everything turned out so beautifully. 

Shouts out to the team of MUAs who stayed down through all the craziness and hard work lol. Some looks they would spend hours on, only for the scene to get cancelled and they still remained with the best of energy. (Not pictured @syntheonline and her team for the special fx). 

Who remembers this era of my career? Oh what a time 😘.

Mondays with @iamvincentanthony go a little sumn like this…
(Yall finna be soccuh me 🤪)

